import React from "react";
import ReactDOM from "react-dom";
import Main from "./Main";
import { ApolloProvider } from '@apollo/react-hooks';


const App = () => (
  <ApolloProvider client={client}>
    <Main/>
  </ApolloProvider>
);



ReactDOM.render(
  <App/>, 
  document.getElementById("root")
);
